import "./app.scss"
import Home from "./home/Home";
import { BrowserRouter, Route, Routes } from "react-router-dom"

// Default route is home
const App = () => {

  return 
  <BrowserRouter>
    <Routes>
      <Route path="/home" element = {<Home/>}> </Route>
    </Routes>
  </BrowserRouter>
};

export default App;
